int main() {
    while (1) { //infinite loop
        //start screen
        drawScreen(1);
        //press enter to start
        while (keyboard() != '\n') {}    //error detection

        //choose game style screen
        drawScreen(2);
        //press 1 to play against computer, press 2 to play multiplayer
        int i = 1;
        char output;
        while (i == 1) {
            output = keyboard();
            if ((output == '2') || (output == '1'))
                i = 0;
        }
        if (output == '1') 
            playComputer();
        else 
            playMultiplayer();
    };
}

